jQuery(document).ready(function($){"use strict";window.wp_consent_type=cl_api.consent_type;$.event.trigger({type:"wpSetConsentTypeChange",consent_type:window.wp_consent_type});function wp_process_consent_change(data){var consentCategories=data.consentCategories;for(var key in consentCategories){if(consentCategories.hasOwnProperty(key)){cl_api_setcookie("wp_consent_"+key,consentCategories[key])}}$.event.trigger({type:"wp_listen_for_consent_change",consentCategories:consentCategories})}$(document).on("wp_apply_consent_change",wp_process_consent_change);var consentCategories=[];consentCategories["marketing"]="allow";$.event.trigger({type:"wp_apply_consent_change",consentCategories:consentCategories});function wpHasConsent(category){var consent_type=window.wp_consent_type;var has_consent_level=false;var cookie_value=cl_api_get_cookie(category);if(!consent_type){has_consent_level=true}else if(consent_type.indexOf("optout")!==-1&&cookie_value===""){has_consent_level=true}else if(cookie_value==="allow"){has_consent_level=true}else{has_consent_level=false}return has_consent_level}function cl_api_setcookie(name,value){var secure=";secure";var days=cl_api.cookie_expiration;var date=new Date;date.setTime(date.getTime()+days*24*60*60*1e3);var expires=";expires="+date.toGMTString();if(window.location.protocol!=="https:")secure="";document.cookie=name+"="+value+secure+expires+";path=/"}function cl_api_get_cookie(cname){var name=cname+"=";var cArr=window.document.cookie.split(";");for(var i=0;i<cArr.length;i++){var c=cArr[i].trim();if(c.indexOf(name)==0)return c.substring(name.length,c.length)}return""}});